var AppSetting;
function canAccess($role){
    if(AppSetting.data.user.role==$role){
        return true
    }
    else{
        return false;
    }
    return false;
}
function httpErrorMessage(err){
    return (err && err.message)
    || (err && err.responseJSON && err.responseJSON.message)
    || 'Something went wrong';
}

function numberFormat(number, dp, currency) {
    if (isNaN(number))
        number = 0;
    if(dp===0){
        dp=0;
    }else if (dp == "" || typeof dp == "undefined") {

        dp = 2;
    }

    var a;
    if (currency && typeof currency == "string") {
        currency = currency ? (currency + " ") : "";
    } else {
        currency = "";
    }

    if (parseFloat(number) < 0) {

        //a = Number(number).toFixed(dp).toString().replace(/\B(?=(\d{3})+(?!\d))/g, ",").replace(/-/, "($") + ")";
        a = Number(number).toFixed(dp).toString().replace(/\B(?=(\d{3})+(?!\d))/g, ",").replace(/-/, "(") + ")";

    } else {

        a = currency + Number(number).toFixed(dp).toString().replace(/\B(?=(\d{3})+(?!\d))/g, ",");

    }

    return a;

}

function cleanNumber(num) {

    num = num + ' ';
    if (num.indexOf("(") > -1) {
        num = num.replace("(", "-");
    }
    num = Number(num.replace(/\D+$/g, "").replace(/[,| |\$]/g, '').replace(/[,| |\%]/g, ''));
    return isNaN(num) ? 0 : num;

}

function formatOrderNo(id){
    if(AppSetting.data.config && AppSetting.data.config.order_prefix){
        return AppSetting.data.config.order_prefix + id;
    }
    return id;
}

function formatPercentage(number, dp) {

    dp = ( dp === undefined ? 0 : dp );

    if (!Number(number)) {

        return Number("0").toFixed(dp) + "%";

    }

    return Number(number).toFixed(dp) + "%";

}
function snakeToTileCase(str,matchedStr,replacedStr){
    if(typeof str =="string" ){
        var regex = new RegExp(matchedStr,"g");
        var val = str.replace(regex,replacedStr);
        return titleCase(val);
    }
    return '';
}
function formatQuantity(x) {
    return (x != null) ? '<div class="text-center">'+numberFormat(x,0)+'</div>' : '';
}
function ordinalDate(date,format,html){
    if(typeof html =="undefined"){
        html = true;
    }
    if(!format){
        format = "YYYY-MM-DD";
    }
    var ordinal = moment(date, format).format('Do');
    var day = moment(date, format).format('D');
    var monthYear = moment(date, format).format('MMMM, Y');

    ordinal = ordinal.replace(/[^rd^st^th^nd]+/,'');
    if(html){
        return day+'<sup>'+ordinal+'</sup>'+' '+monthYear;
    }else{
        return day+ordinal+' '+monthYear;
    }
}
function currencyFormat(x) {
    if (x != null) {
        return '<div class="text-right">'+numberFormat(x,2)+'</div>';
    } else {
        return '<div class="text-right">0</div>';
    }
}
function checkbox(data) {
    var checkbox = '<div class="text-center"><input class="checkbox multi-select" type="checkbox" name="val[]" value="' + data + '" /></div>';
    //AppSetting.initICheck(".multi-select");
    return checkbox;
}
function inputSwitcher(data) {
    //console.log(data);
    var switcher = '<div class="form-group fgh">'+
        '<input type="checkbox" class="switchery" value="' + data + '" '+ (data && " checked " || "") + '/>'+
        //'<label for="switchery" class="font-medium-2 text-bold-600 ml-1">Switchery Default</label>'+
        '</div>';
    //AppSetting.initICheck(".multi-select");
    return switcher;
}
function titleCase(str) {

    str = str || "";
    if(typeof str !="string" ){str=String(str);}
    if(str.toUpperCase()==str){
        return str;
    }
    return str.toLowerCase().replace(/(?:^|[\s-/])\w/g, function (match) {
        return match.toUpperCase();
    });
    //return str.replace(/\w\S*/g, function(txt){return txt.charAt(0).toUpperCase() + txt.substr(1).toLowerCase();});
}
function getDeepProp(obj, props) {
    return props.split('.').reduce(function(acc, p) {
        if (acc == null) return
        return acc[p]
    },obj)
}
function getCartStatusDropdown(){
    if(AppSetting.data.config && AppSetting.data.config.cart_status){
        return AppSetting.data.config.cart_status;
    }
    return [];
}
function row_status(x) {
    //console.log("x",x,['pending','in-process'].indexOf(x)!=-1);
    if(x == null) {
        return '';
    } else if(['pending','in-progress'].indexOf(x)!=-1) {
        return '<div class="text-center"><span class="badge  badge-warning">'+titleCase(x)+'</span></div>';
    }else if(['designing','payment-confirmed'].indexOf(x)!=-1) {
        return '<div class="text-center"><span class="badge bg-purple bg-lighten-1 white">'+titleCase(x)+'</span></div>';
    }else if(['completed', 'paid', 'sent' ,'received', 'stock-in', 'delivered'].indexOf(x)!=-1 ){
        return '<div class="text-center"><span class="badge badge-success">'+titleCase(x)+'</span></div>';
    }else if(['ready','order-placed'].indexOf(x)!=-1){
        return '<div class="text-center"><span class="badge bg-teal bg-lighten-3 white">'+titleCase(x)+'</span></div>';
    }else if(['partial', 'transferring', 'ordered' ,'dispatched'].indexOf(x)!=-1) {
        return '<div class="text-center"><span class="badge badge-info">'+titleCase(x)+'</span></div>';
    }else if(['due', 'returned', 'stock-out'].indexOf(x)!=-1) {
        return '<div class="text-center"><span class="badge badge-danger">'+titleCase(x)+'</span></div>';
    } else {
        return '<div class="text-center"><span class="badge badge-secondary">'+titleCase(x)+'</span></div>';
    }
}
function twoDigitFormat(n){
    return n > 9 ? "" + n: "0" + n;
}
function fld(oObj) {
    var site = { dateFormats:{"js_sdate":'dd-mm-yyyy'} };
    if (oObj != null) {
        var aDate = oObj.split('-');
        var bDate = aDate[2].split(' ');
        year = aDate[0], month = aDate[1], day = bDate[0], time = bDate[1];
        if (site.dateFormats.js_sdate == 'dd-mm-yyyy')
            return day + "-" + month + "-" + year + " " + time;
        else if (site.dateFormats.js_sdate === 'dd/mm/yyyy')
            return day + "/" + month + "/" + year + " " + time;
        else if (site.dateFormats.js_sdate == 'dd.mm.yyyy')
            return day + "." + month + "." + year + " " + time;
        else if (site.dateFormats.js_sdate == 'mm/dd/yyyy')
            return month + "/" + day + "/" + year + " " + time;
        else if (site.dateFormats.js_sdate == 'mm-dd-yyyy')
            return month + "-" + day + "-" + year + " " + time;
        else if (site.dateFormats.js_sdate == 'mm.dd.yyyy')
            return month + "." + day + "." + year + " " + time;
        else
            return oObj;
    } else {
        return '';
    }
}

function fsd(oObj) {
    var site = { dateFormats:{"js_sdate":'dd-mm-yyyy'} };
    if (oObj != null) {
        var aDate = oObj.split('-');
        if (site.dateFormats.js_sdate == 'dd-mm-yyyy')
            return aDate[2] + "-" + aDate[1] + "-" + aDate[0];
        else if (site.dateFormats.js_sdate === 'dd/mm/yyyy')
            return aDate[2] + "/" + aDate[1] + "/" + aDate[0];
        else if (site.dateFormats.js_sdate == 'dd.mm.yyyy')
            return aDate[2] + "." + aDate[1] + "." + aDate[0];
        else if (site.dateFormats.js_sdate == 'mm/dd/yyyy')
            return aDate[1] + "/" + aDate[2] + "/" + aDate[0];
        else if (site.dateFormats.js_sdate == 'mm-dd-yyyy')
            return aDate[1] + "-" + aDate[2] + "-" + aDate[0];
        else if (site.dateFormats.js_sdate == 'mm.dd.yyyy')
            return aDate[1] + "." + aDate[2] + "." + aDate[0];
        else
            return oObj;
    } else {
        return '';
    }
}
